    public PostInfo getdata(){
        postInfo=new PostInfo();
        if(this.articles==null){
            return null;
        }
        postInfo.setCount(this.articles.size()+"");
        ArrayList<PostInfo.InfoBean> postinfobeanlist=new ArrayList<>();
        for (SouHu.ArticlesBean b:articles
        ) {
            PostInfo.InfoBean bean=new PostInfo.InfoBean();
            bean.setCreateTime(b.getUpdateTime());
            bean.setItemAuthor(b.getMedia());

            bean.setItemDomain(getChannelName());
            bean.setItemType("1");
            bean.setItemTitle(b.getTitle());
            bean.setItemSource("搜狐");
            bean.setItemUrl("http://3g.k.sohu.com/t/n"+b.getNewsId());
            bean.setItemComment("0");
            bean.setItemRead("0");
            postinfobeanlist.add(bean);
        }
        postInfo.setInfo(postinfobeanlist);
        return postInfo;
    }
